import React, { Component } from "react";
import "./css/App.css";
import Cell from "./Cell"

class Game extends Component{
    constructor(props){
        super(props);
        this.state={
            score:0,
            name:props.name,
            data:[[1,2,3],[4,5,6]]
        }
    }

    componentDidMount() {
        fetch('http://localhost:3001/api/getScore')
            .then(result => result.json())
            .then(res => this.setState({score:res.score}))
    }
    render(){
        const score=this.state.score;
        const data= this.state.data;
        return (<div>
        <h1> {score}</h1>
        <table>
        <tbody>
          {data.length <= 0
            ? "NO DB ENTRIES YET"
            : data.map(dat => (
                <tr>
                  <th > <Cell key="1" num={dat[0]} /> </th>
                  <th > <Cell key="2" num ={dat[1]}/> </th>
                  <th > <Cell key="3" num={dat[2]} /> </th>
                 
                </tr>
              ))}
              </tbody>
                </table>
            

         
     
    
        </div>);

    }
} 
export default Game;
